import react from "react"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import congaIcon from "../images/conga-icon.png";
import {Link, Route} from 'react-router-dom';

function NavBar() {
    return (
        <nav>
            <div className="logo-container">
                <img src={congaIcon} alt="hi"></img>
                <h3 className="title">SC Drum Co.</h3>
            </div>
            <div className="nav-links">
                <li><Link to="/">Home</Link></li>
                <li><Link to="../Pages/Gallery"></Link>Gallery</li>
                <li><Link to="../Pages/Shop"></Link>Shop</li>
                <li><Link to="../Pages/ContactUs"></Link>Contact Us</li>
            </div>
        </nav>
    )
}

export default NavBar;
